import "./Sidebar.css";
import { ReactComponent as Arrow } from "../../icons/Arrow.svg";
import { ReactComponent as Dashboard } from "../../icons/Dashboard.svg";
import { ReactComponent as Settings } from "../../icons/Settings.svg";
import { ReactComponent as Tasks } from "../../icons/Tasks.svg";
import { ReactComponent as Sitemap } from "../../icons/Sitemap.svg";

const Sidebar = () => {
  let url = "#";
  return (
    <nav className="sidebar">
      <ul className="sidebar-nav">
        <li class="side-logo">
          <a href={url} class="nav-link">
            <span className="sidelink-text sidelogo-text">Fireship</span>
            <Arrow />
          </a>
        </li>
        <li className="sidenav-item">
          <a href={url} className="sidenav-link">
            <Dashboard/>
            <span class="sidelink-text">Dashboard</span>
          </a>
        </li>
        <li className="sidenav-item">
          <a href={url} className="sidenav-link">
            <Tasks/>
            <span class="sidelink-text">My Tasks</span>
          </a>
        </li>
        <li className="sidenav-item">
          <a href={url} className="sidenav-link">
            <Tasks/>
            <span class="sidelink-text">Organisation</span>
          </a>
        </li>
        <li className="sidenav-item">
          <a href={url} className="sidenav-link">
            <Settings/>
            <span class="sidelink-text">Settings</span>
          </a>
        </li>
      </ul>
    </nav>
  );
};

export default Sidebar;
